import React, { Component } from "react";
import Home from "./components/home";
import GodzillaRoute from "./components/godzilla/godzillaListPage";
import MechagodzillaListDisplay from "./components/mechagodzilla/mechagodzillaListPage";
import MechagodzillaRouter from "./components/mechagodzilla/mechagodzillaRouter";
import GhidorahListDisplay from "./components/ghidorah/ghidorahListPage";
import GhidorahRouter from "./components/ghidorah/ghidorahListPage";
import Header from "./components/common/header";
import Footer from "./components/common/footer";
import { Route, Switch } from "react-router-dom";

const GodzillaRouter = GodzillaRoute.GodzillaRouter;
const GodzillaListDisplay = GodzillaRoute.GodzillaListDisplay;

class App extends Component {
  render() {
    return (
      <>
        <Header />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/godzilla-list" component={GodzillaListDisplay} />
          <GodzillaRouter />
          <Route
            path="/mechagodzilla-list"
            component={MechagodzillaListDisplay}
          />
          <MechagodzillaRouter />
          <Route path="/ghidorah-list" component={GhidorahListDisplay} />
          <GhidorahRouter />
        </Switch>
        <Footer />
      </>
    );
  }
}

export default App;
